import './index.css';

import * as serviceWorker from './serviceWorker';

import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Map from 'src/components/Map.js';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import React from 'react';
import ReactDOM from 'react-dom';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import svgfile1 from './menu-button.svg';
import svgfile2 from './whereandwear-logo.svg';

// Importing images/icons



// Card styling constants
const cardStyles = makeStyles({
  root: {
    width: 275,
    height: 300,
    margin: 35,
    position: 'absolute',
    bottom: 50,
    borderRadius: 25,
  },
  moreDetails: {
    position: 'absolute',
    padding: '5%',
    right: 0,
    top: 0,
    fontFamily: 'Calibri',
  },
  title: {
    fontSize: 20,
    top: '5%',
    position: 'absolute',
  },
  secondTitle: {
    fontSize: 20,
    top: '40%',
    position: 'absolute',
  },
  pos: {
    marginTop: 12,
    position: 'relative',
  },
  buttonStyle: {
    position: 'relative',
    top: 5,
    left: '90%',
    width: '10%',
    height: '10%',
  },
});

// CreateWeatherCard() function returns a weather card overlay
export default function CreateWeatherCard(props) {
  const classes = cardStyles();

  return (
    <Card className={classes.root}>
      <CardActions>
        <Button size="small" className={classes.moreDetails}>More Details</Button>
      </CardActions>
      <CardContent>
        <Typography className={classes.title} gutterBottom>{props.name}</Typography>
        <Typography className={classes.pos} color="textSecondary">25C / Sunny</Typography>
        <Typography className={classes.secondTitle} gutterBottom>Clothing Suggestions</Typography>
      </CardContent>
    </Card>
  );
}

// CreateMenu() function returns the menu
function CreateMenu() {
  const classes = cardStyles();
  const [anchorEl, setAnchorEl] = React.useState(null);
  const handleClick = (event) => {setAnchorEl(event.currentTarget)}
  const handleClose = () => {setAnchorEl(null);};

  return (
      <div>
        <Button className={classes.buttonStyle} onClick={handleClick}>
          <img src={svgfile1} height='60%' width='60%' alt='Menu Button'/>
        </Button>
        <Menu className={classes.menuStyle} anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleClose}>
          <MenuItem onClick={null}>About Us</MenuItem>
          <MenuItem onClick={handleClose}> <img src={svgfile2} height='50%' width='50%' alt='Where & Wear Logo'/> </MenuItem>
        </Menu>
      </div>
    );
}

ReactDOM.render(
  <div>
    <Map />
  </div>,
  document.getElementById('root')
);



// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
